features.script:
feature.on("click", (e) => {
  console.log("start booting")
  let loader = parcel.getFeatureById("require.js").get("text");
  console.log(loader)
  try {
    this.eval(loader);
    console.log("DONE")
  } catch(err) {
    console.log("# Err: " + err.message)
    console.log(err)
  }
})

feature.on("click", (e) => {
  const socket = new WebSocket('wss://grid.cryptovoxels.com/grid/4881?id=0x7a44d904e5372f64db51436fcdf4024a8144c383');
  socket.addEventListener('open', function (event) {
    socket.send('Hello Server!');
  });

  socket.addEventListener('message', function (event) {
    console.log('Message from server ', event.data);
  });
  console.log(feature)
})

var display = parcel.getFeatureById("wssConsole");
var input = parcel.getFeatureById("wssInput");
feature.on("click", (e) => {
  this.socket.send(input.text);
    var origin = display.text;
    display.set({"text": origin + "\n\n" + "input: " + input.text})

})

var display = parcel.getFeatureById("wssConsole");
feature.on("click", (e) => {
  this.socket = new WebSocket('wss://grid.cryptovoxels.com/grid/4881?id=' + e.player.wallet);
  this.socket.addEventListener('open', function (event) {
    socket.send('Hello Server!');
  });

  this.socket.addEventListener('message', function (event) {
    console.log('Message from server ' + JSON.stringify(event.data));
    var origin = display.text;
    display.set({"text": origin + "\n\n" + event.data})
  });
})

feature.on("click", (e) => {
  console.log("start booting")
  let loader = parcel.getFeatureById("bootloader.js").get("text");
  console.log(loader);
  try {
    this.eval(loader);
    console.log("done")
  } catch(err) {
    console.log("# Err: " + err.message)
  }
})
